(function(){'use strict';var elementBaseUrl=document.querySelector('#input_baseUrl'),url=elementBaseUrl.value,ui;if(SwaggerTranslator){SwaggerTranslator.translate();}
function addApiKeyAuthorization(e){var key=encodeURIComponent(e.target.value).trim();if(key){ui.getConfigs().requestInterceptor=function(req){req.headers.Authorization='Bearer '+key;return req;};}}
ui=new SwaggerUIBundle({url:url,dom_id:'#swagger-ui-container',presets:[SwaggerUIBundle.presets.apis,SwaggerUIStandalonePreset],plugins:[SwaggerUIBundle.plugins.DownloadUrl],deepLinking:true,supportedSubmitMethods:['get','post','put','delete','patch'],docExpansion:'none',apisSorter:'alpha',showRequestHeaders:false,layout:'StandaloneLayout'});document.querySelector('#input_apiKey').addEventListener('change',addApiKeyAuthorization);document.querySelector('#explore').addEventListener('click',function(){ui.specActions.download();});})();